import React from 'react';
import { BarChartIcon } from 'lucide-react';
import { Button } from '@/lib/components/Button.tsx';
import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuRadioGroup,
  DropdownMenuRadioItem,
  DropdownMenuTrigger,
} from './lib/components/DropdownMenu';
import { StockPriceType } from './components/StockPriceChart';

interface PriceTypeSelectorProps {
  priceType: StockPriceType;
  onPriceTypeChange: (type: StockPriceType) => void;
}

const PriceTypeSelector: React.FC<PriceTypeSelectorProps> = ({
  priceType,
  onPriceTypeChange,
}) => {
  return (
    <DropdownMenu>
      <DropdownMenuTrigger asChild>
        <Button
          variant="outline"
          className={`
            mt-4 flex w-full items-center gap-2 text-gray-800

            dark:text-gray-200

            md:mt-0 md:w-auto
          `}
        >
          <BarChartIcon
            className={`
            size-4 text-gray-500

            dark:text-gray-400
          `}
          />
          {priceType.toUpperCase()}
        </Button>
      </DropdownMenuTrigger>
      <DropdownMenuContent>
        <DropdownMenuRadioGroup
          value={priceType}
          onValueChange={onPriceTypeChange as () => void}
        >
          <DropdownMenuRadioItem
            value="open"
            className={`
              text-gray-800

              dark:text-gray-200
            `}
          >
            Open
          </DropdownMenuRadioItem>
          <DropdownMenuRadioItem
            value="high"
            className={`
              text-gray-800

              dark:text-gray-200
            `}
          >
            High
          </DropdownMenuRadioItem>
          <DropdownMenuRadioItem
            value="low"
            className={`
              text-gray-800

              dark:text-gray-200
            `}
          >
            Low
          </DropdownMenuRadioItem>
          <DropdownMenuRadioItem
            value="close"
            className={`
              text-gray-800

              dark:text-gray-200
            `}
          >
            Close
          </DropdownMenuRadioItem>
        </DropdownMenuRadioGroup>
      </DropdownMenuContent>
    </DropdownMenu>
  );
};

export default PriceTypeSelector;
